import React, { Component, Fragment } from 'react';
import Box from '../component/box';
import './App.css';

class MainPage extends Component{
  render () {
  return (
    <Fragment>
      <Box className="leftSide"/>
      <Box className="rightSide"/>
    </Fragment>
    );
  }
}

export default MainPage;
